    "nist-8-bit-gray-scale-images-of-fingerprint-image-groups-figs-nist-special-database-4",nt"isopen":
    true,nt"url": null,nt"notes": "This NIST database of fingerprint images
    contains 2,000 8-bit gray scale fingerprint image pairs. Each image is 512-by-512
    pixels (32 rows of white space at the bottom), scanning resolution was 19.7 pixels
    per millimeter, and classified using one of the five following classes: A=Arch,
    L=Left Loop, R=Right Loop, T=Tented Arch, W=Whorl. The database is evenly distributed
    over each of the five classifications with 400 fingerprint pairs from each class.
    rnrn The images are PNG formatted with a text file that accompanies each image that
    gives the Gender, Class and History information extracted from the ANSI/NIST-ITL
    formatted (AN2) file. rnrn It is suitable for automated fingerprint classification
    research, the database can be used for algorithm development or system training
    and testing.",nt"license_title": "Other License Specified",nt"extras":
